//now download all the file created after done file 
String e2bOutPath = testRunner.testCase.testSteps["course-properties"].getPropertyValue("e2bOutFolder")
String server = testRunner.testCase.testSteps["course-properties"].getPropertyValue("server")
String username = testRunner.testCase.testSteps["course-properties"].getPropertyValue("username")
String password = testRunner.testCase.testSteps["course-properties"].getPropertyValue("password")
int port = Integer.parseInt(testRunner.testCase.testSteps["course-properties"].getPropertyValue("port"))
String reportId = testRunner.testCase.testSteps["course-properties"].getPropertyValue("reportId")
String messageNumber = testRunner.testCase.testSteps["course-properties"].getPropertyValue("messageNumber")

JSch jsch = new JSch()
Session session = null
SftpATTRS attrs
try {

   session = jsch.getSession(username, server, port)
   session.setConfig("StrictHostKeyChecking", "no")
   session.setPassword(password)
   session.connect()

   Channel channel = session.openChannel("sftp")
   channel.connect();
   ChannelSftp sftpChannel = (ChannelSftp) channel
  // String currentDirectory = sftpChannel.pwd()
  // println("current directory : ${currentDirectory}")
   sftpChannel.cd("${e2bDonePath}/")
   log.info("current directory : ${sftpChannel.pwd()}")
   try {
   	attrs = sftpChannel.lstat(e2bFileName)
   }
   catch(Exception e) {
   	  log.error("e2b file ${e2bFileName} not found in done folder")
   	  testRunner.fail("e2b file ${e2bFileName} not found in done folder")
   }
   int lastUploadedModifiedDate = attrs.getMTime()
   log.info("lastUploaded Mtime : ${attrs.getMTime()}")

   //Create temp folder in local directory
   File tempDirectory = new File("${System.getProperty('user.home')}/temp")
   if(!tempDirectory.exists()){
       tempDirectory.mkdir()
   }
   //Cleanup temp directory before copying files
   FileUtils.cleanDirectory(tempDirectory)

   sftpChannel.cd("${e2bOutPath}/")
   log.info("current directory : ${sftpChannel.pwd()}")       
   Vector<ChannelSftp.LsEntry> entries = sftpChannel.ls("*").findAll { it.getAttrs().getMTime() > lastUploadedModifiedDate || it.getAttrs().getMTime() == lastUploadedModifiedDate } 
   log.info("entries : ${entries.size()}");
   for (ChannelSftp.LsEntry entry : entries) {      
           //get output stream
           OutputStream output = new FileOutputStream("${tempDirectory.getPath()}/${entry.getFilename()}");
           sftpChannel.get(entry.getFilename(), output)     
   }

   sftpChannel.exit()
   boolean status = false
   //look for success or failures in the file.
   log.info("find .act file which has messageNumber ${messageNumber} ")
   File actFile = tempDirectory.listFiles().find {  it.text.contains("<icsrmessagenumb>${messageNumber}</icsrmessagenumb>") && it.text.contains("<reportacknowledgmentcode>") }
   if(actFile) {
   	 log.info("The e2b ${e2bFileName} submitted successfully ")		
   }
   else {
   	  log.error("e2b ${e2bFileName} submission failed")
   	  testRunner.fail("e2b ${e2bFileName} submission failed")
   }  

} catch (JSchException e) {
   e.printStackTrace();
} catch (SftpException e) {
   e.printStackTrace();
}
finally {
   session.disconnect();
}

// fail: https://dev.semanticbits.com/caaers/services/SAEEvaluationService
// pass: http://10.10.10.61:6611/caaers/services/RaveIntegrationServices

testCase = testRunner.testCase;
testStep = testCase.getTestStepAt(0)

// get properties
sendBOM = "true".equals(testCase.getPropertyValue("sendBOM"))
socketTimeout = testCase.getPropertyValue("socketTimeout").toInteger() // 10000
endpoint = testStep.getPropertyValue("endpoint");
post = new String(testStep.testRequest.messageExchange.rawRequestData)
xml = testStep.testRequest.messageExchange.requestContent

url = new URL(endpoint)
host = url.getHost()
port = url.getPort()
isSSL = url.getProtocol() == "https"
charset = java.nio.charset.StandardCharsets.UTF_8

if (port <= 0) {
	if (isSSL) port = 443
	else port = 80
}

// build soap payload
xmlBytes = xml.getBytes(charset)
bomBytes = new String("\uFEFF").getBytes()
if (! sendBOM) bomBytes = new byte[0]
message = new byte[xmlBytes.length + bomBytes.length]
System.arraycopy(bomBytes, 0, message, 0, bomBytes.length);
System.arraycopy(xmlBytes, 0, message, bomBytes.length, xmlBytes.length);

// modify the content-length to include bom
if (sendBOM) {
	post = post.replaceFirst(/Content-Length\: (\d+)/) { all, length -> 
		"Content-Length: " + message.length
	}
}

// pront out some debug info
log.info "BOM Host: " + host
log.info "BOM Port: " + port
log.info "BOM Post: " + post
log.info "BOM XML: " + xml
log.info "BOM Message length: " + message.length

sock = new Socket(url.getHost(), port)

// wrap with an ssl socket if we are using ssl
if (isSSL) {
	sock = javax.net.ssl.SSLSocketFactory.getDefault().createSocket(sock, host, port, true)
}

// set a socket timeout for poorly bahaving servers
if (socketTimeout) {
	sock.setSoTimeout(socketTimeout)
	log.info "BOM Timeout: " + socketTimeout
}

// if you need to debug the payload, uncomment the two lines below and change the file path
//new File("/Users/mccon012",'message.xml').withOutputStream { out ->
//	out.write(message)
//}

// send the http details then the soap payload
// read the response
resp = ""
try {
	os = sock.getOutputStream()
	is = sock.getInputStream()

	os.write(post.getBytes(charset))
	os.write(message)
	os.flush()

	byte[] buf = new byte[1024]
	int count = 0
	while ((count = is.read(buf, 0, buf.length)) != -1) {
		resp += new String(buf, 0, count)
	}	

	os.close()
	is.close()
} catch (SocketTimeoutException e) {
	log.warn "BOM socket timed out but will check response anyway"
} finally {
	sock.close()
}

// print debug message
log.info "BOM Response: " + resp

// assert that we get 200 response code
assert resp.startsWith("HTTP/1.1 200 OK") == true : "BOM failed - didn't return  200"
// assert that the payload contains some real stuff
assert resp.contains("saveAndEvaluateAEsResponse") == true : "BOM failed - couldn't find saveAndEvaluateAEs in response"
